export {}

export class Exercicio {

    nome: string
    nm_repeticoes: string
    nm_series: string

    constructor(nm: string,
                rep: string,
                ser: string){

        this.nome = nm;
        this.nm_repeticoes = rep;
        this.nm_series = ser;
    }
}

export class ComposicaoCorporal {

    peso: string
    altura: string
    imc: string
    idade_metabolica: string
    massa_magra: string
    massa_gorda: string

    constructor(peso: string,
                altura: string,
                imc: string,
                idade_metabolica: string,
                massa_magra: string,
                massa_gorda: string) {

        this.peso = peso;
        this.altura = altura;
        this.imc = imc;
        this.idade_metabolica = idade_metabolica;
        this.massa_magra = massa_magra;
        this.lista_exercicios = JSON.parse(JSON.stringify(list))
    }
}

export class Perimetros {

    peso: string
    altura: string
    imc: string
    idade_metabolica: string
    massa_magra: string
    lista_exercicios: Array<Exercicio>

    constructor(peso: string,
                altura: string,
                imc: string,
                idade_metabolica: string,
                massa_magra: string,
                list: Array<Exercicio>) {

        this.peso = peso;
        this.altura = altura;
        this.imc = imc;
        this.idade_metabolica = idade_metabolica;
        this.massa_magra = massa_magra;
        this.lista_exercicios = JSON.parse(JSON.stringify(list))
    }
}

export class Avaliacao {

    peso: string
    altura: string
    imc: string
    idade_metabolica: string
    massa_magra: string
    lista_exercicios: Array<Exercicio>

    constructor(peso: string,
                altura: string,
                imc: string,
                idade_metabolica: string,
                massa_magra: string,
                list: Array<Exercicio>) {

        this.peso = peso;
        this.altura = altura;
        this.imc = imc;
        this.idade_metabolica = idade_metabolica;
        this.massa_magra = massa_magra;
        this.lista_exercicios = JSON.parse(JSON.stringify(list))
    }
}
